import Card from 'react-bootstrap/Card';

const RecipeItem = (props) => {
    return (
        <Card>
            <Card.Header>
                {props.title}
            </Card.Header>
            <Card.Body>
                <h2>{props.image}</h2>
            </Card.Body>
        </Card>
    )
}

export default RecipeItem;
